rect\" title=\"1900\">1900<\/a>&#160;\u2014 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D0%BC%D0%B8%D1%80%D0%BD%D0%B0%D1%8F_%D0%B2%D1%8B%D1%81%D1%82%D0%B0%D0%B2%D0%BA%D0%B0_(1900)\" title=\"\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u0430\u044f \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430 (1900)\">\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u043e\u0439 \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0435 \u0432 \u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u0434\u0430\u0442\u0441\u043a\u0438\u0439 \u0438\u043d\u0436\u0435\u043d\u0435\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%83%D0%BB%D1%8C%D1%81%D0%B5%D0%BD,_%D0%92%D0%B0%D0%BB%D1%8C%D0%B4%D0%B5%D0%BC%D0%B0%D1%80\" title=\"\u041f\u043e\u0443\u043b\u044c\u0441\u0435\u043d, \u0412\u0430\u043b\u044c\u0434\u0435\u043c\u0430\u0440\">\u0412\u0430\u043b\u044c\u0434\u0435\u043c\u0430\u0440 \u041f\u043e\u0443\u043b\u044c\u0441\u0435\u043d<\/a> \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u043b \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0451\u043d\u043d\u044b\u0439 \u0438\u043c \u043f\u0440\u0438\u0431\u043e\u0440&#160;\u2014 \u0442\u0435\u043b\u0435\u0433\u0440\u0430\u0444\u043e\u043d. \u041f\u043e \u0441\u0443\u0442\u0438, \u044d\u0442\u043e \u0431\u044b\u043b\u0430 \u043c\u0430\u0433\u043d\u0438\u0442\u043d\u0430\u044f \u043b\u0435\u043d\u0442\u0430 \u0434\u043b\u044f \u0437\u0432\u0443\u043a\u043e\u0437\u0430\u043f\u0438\u0441\u0438.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1908\" class=\"mw-redirect\" title=\"1908\">1908<\/a>&#160;\u2014 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0438\u0441\u044c \u043f\u0435\u0440\u0432\u044b\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0